import React from "react";

function MedicalBillingCoding() {
  return (
    <div
      className="px-md-5 px-3 mx-md-4 mx-2 white-bg"
      data-aos="fade-right"
      data-aos-easing="ease-in-sine">
        
        <div className="container contact_div">
        <h2 className="div-heading mt-5" data-aos="flip-left">
        Free Medical Billing & Coding Audit
        </h2>
          <div className="row">
          <div className="col-md-8 col-10 m-auto">
          <img src="" alt="" />
            <p>Want a professional billing expert to audit your accounts? Pharmacare Billing Solution has brought amazing discount offers for all healthcare practitioners. Book a free business consultation session with our medical billing experts to examine your accounts, medical claims, and the progress of your practice revenue cycle management.</p>
          
          </div>
        </div>
      </div>
    </div>
  );
}

export default MedicalBillingCoding;
